import React from 'react';
import Button from 'react-bootstrap/Button';

const Login = () => {
    
    return(
        <>
        <h6>Kirjoita käyttäjätunnus ja salasana</h6>
          <label>
            Käyttäjätunnus:
            <br />
            <input></input>
          </label>
          <br />
          <label>
            Salasana:
            <br />
            <input></input>
          </label>
          <br />
          <Button id="logIn" onClick={() =>{setModalShow(false); setVisible(false)}}>Kirjaudu sisään</Button>
          </>
    )
}
export default Login;
